const obj = WORLD.getObject("OBJECT_MOVE_LIMIT")
const start = {x: obj.position.x}
const end = {x: start.x+5}
const tween = new TWEEN.Tween(start).to(end, 1000)
    .onUpdate(()=>{
        obj.position.x = start.x;
    });

function Start() {
    this.onCollide(PLAYER, ()=>{
        tween.start();
    })
}

function Update(dt) {
    // 아무것도 안해도 됨
}

REDBRICK.Signal.addListener("RESTART", ()=>{
    obj.position.x = start.x;
})

const startLocation = WORLD.getObject("StartLocation(e72)");

function Start() {
    this.onCollide(PLAYER, () => {
        PLAYER.spawn(startLocation);
    });
}

function Update(dt) {
    if (PLAYER.position.y < -10){ //떨어지면 respawn
        PLAYER.spawn(startLocation);

    }
}

const box = WORLD.getObject("DEV_BOX_01(889)");

function Start() {
	this.onCollide(PLAYER, ()=>{
	    box.visible = false;
	})
}

function Update(dt) {

}

REDBRICK.Signal.addListener("RESTART", ()=>{
    box.visible = true;
})

const rotateBox = WORLD.getObject("DEV_BOX_01_BLUE(615)");
const initRotation = rotateBox.rotation.y;
let isRotate = false;

function Start() {
    this.onCollide(PLAYER, ()=>{
        isRotate = !isRotate;
    })	
}

function Update(dt) {
	if (isRotate) rotateBox.rotation.y += dt/2;
}

REDBRICK.Signal.addListener("RESTART", ()=>{
    isRotate = false;
    rotateBox.rotation.y = initRotation;
})

const rotateBox = WORLD.getObject("DEV_BOX_01_BLUE(8e9)");

function triggerRotate(){
    const start = {y: rotateBox.rotation.y}
    const end = {y: start.y+Math.PI/2}
    const tween = new TWEEN.Tween(start).to(end , 500)
    .onUpdate(()=>{
        rotateBox.rotation.y = start.y;
    }).start();
}
function Start() {
	this.onCollide(PLAYER, ()=>{
	    triggerRotate();
	})
}

function Update(dt) {

}

const moveBox = WORLD.getObject("OBJECT_MOVE");
const initPos = moveBox.position.clone();

console.log("INIT POS", initPos)

let isMove = false;

function Start() {
	this.onCollide(PLAYER, ()=>{
	    isMove = !isMove;
	});
}

function Update(dt) {
	if (isMove) moveBox.position.z += dt;
}
REDBRICK.Signal.addListener("RESTART", ()=>{
    moveBox.position.set(initPos.x, initPos.y, initPos.z);
    isMove = false;
})
